import axios from 'axios'

const BASE_URL = 'http://localhost:8000/api/'
const TOKEN =
  'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyZjUxNzM0N2M1Zjc5YzRjODc5MTdjZCIsImlzQWRtaW4iOnRydWUsImlhdCI6MTY2MDUwMjIzMywiZXhwIjoxNjYwNTg4NjMzfQ.A2sH_B0kY-YlfCUWF2Olq-oF7vl8jTGPvQxPpNBDDa8'

export const publicRequest = axios.create({ baseURL: BASE_URL })

export const userRequest = axios.create({
  baseURL: BASE_URL,
  header: { token: `Bearer ${TOKEN}` },
})
